// SPDX-License-Identifier: GPL-3.0
pragma solidity >=0.7.0 <0.8.4;


contract Auctions{
 address public highestBidder;
 uint public highestBid;
 mapping(address=>uint) public bidderBalance;
 event moveFunds(address bidder, uint amount);

 constructor(){
    highestBidder=msg.sender;
    highestBid=0;
 }


 function bid() public payable{

	 /// Bid on the auction with the value sent
	 /// together with this transaction.
	 /// The value will only be refunded if the
	 /// auction is not won.
    require(msg.value>highestBid,"Not the highest bid"); 
    if(msg.value>highestBid)  
         bidderBalance[msg.sender]=highestBid;

    highestBid=msg.value;
    highestBidder=msg.sender;
    emit moveFunds(msg.sender,msg.value);

}


function withdraw() public returns(bool){
bool succesful;
uint amount=bidderBalance[msg.sender];

  require(msg.sender != highestBidder, "highest bidder can't withdraw!");

 if(amount>0){
    bidderBalance[msg.sender]=0;



    if(!payable(msg.sender).send(bidderBalance[msg.sender])){
        bidderBalance[msg.sender]=amount;
    return !succesful;
    }
 }
return succesful;
 }

     receive() external payable{}
}
